import Vue from 'vue';
import {Button,Input,Container,Main,Header,Aside,Select,Option} from 'element-ui';
import 'element-ui/lib/theme-chalk/index.css';
import App from './App.vue';
import router from '../router'
Vue.use(Button);
Vue.use(Input);
Vue.use(Container);
Vue.use(Main);
Vue.use(Header);
Vue.use(Aside);
Vue.use(Select);
Vue.use(Option);

new Vue({
  router,
  el: '#app',
  render: h => h(App)
});
